Question: In the program below, the initial value of x is 5 and the initial value of y is 10.
 IF (X < O)
 {
 DISPLAY ("Foxtrot")
 }
 ELSE
 {
 IF (X > y)
 {
   DISPLAY ("Hotel")
 }
 ELSE 
 {
   IF (y > O)
   {
   DISPLAY ("November")
   }
   ELSE
   {
   DISPLAY ("Yankee")
   }
 }
 }

 What is displayed as a result of running the program?

Choices:
A: Foxtrot
B: Hotel
C: November
D: Yankee

Question: The amount of paint that David needs to cover a cube is directly proportional to the surface area. If David can completely cover a cube of side length 2 feet with exactly 16 quarts of paint, how big a cube (in terms of edge length in feet) can David cover with 169 quarts of paint?

Choices:
A: \frac{13}{4}
B: 8
C: \frac{13}{2}
D: 13

Question: Simplify and write the result with a rational denominator: $$\sqrt{\sqrt[3]{\sqrt{\frac{1}{729}}}}$$

Choices:
A: \frac{3\sqrt{3}}{3}
B: \frac{1}{3}
C: \sqrt{3}
D: \frac{\sqrt{3}}{3}

Question: A point $(x,y)$ is randomly picked from inside the rectangle with vertices $(0,0)$, $(3,0)$, $(3,2)$, and $(0,2)$. What is the probability that $x < y$?

Choices:
A: \frac{1}{12}
B: \frac{1}{6}
C: \frac{2}{3}
D: \frac{1}{3}

Question: If we express $3x^2 + x - 4$ in the form $a(x - h)^2 + k$, then what is $k$?

Choices:
A: -\frac{7}{12}
B: -7
C: 49
D: -\frac{49}{12}

Question: Mr. Patrick is preparing a five-question true-false quiz for his class. He flips a coin before writing the first question. If it is heads, he writes a true statement and if it is tails, he writes a false statement. He continues this until all five statements are written. What is the probability that the correct sequence of answers is TFTFT ? Express your answer as a common fraction.

Choices:
A: \frac{1}{6}
B: \frac{1}{64}
C: \frac{1}{32}
D: \frac{1}{2}

Question: Express $0.1\overline{7}$ as a common fraction.

Choices:
A: \frac{8}{45}
B: \frac{8}{5}
C: \frac{8}{7}
D: \frac{8}{33}

Question: 3 cards are chosen at random from a standard 52-card deck. What is the probability that they form a pair? (A 3-card hand is a 'pair' if two of the cards match in rank but the third card is different. For example, 668 is a pair, but 999 is not.)

Choices:
A: \frac{1}{8}
B: \frac{1}{36}
C: \frac{1}{78}
D: \frac{72}{425}

Question: We roll a fair 6-sided die 5 times. What is the probability that we get a 6 in at most 2 of the rolls?

Choices:
A: \frac{125}{648}
B: \frac{25}{648}
C: \frac{625}{648}
D: \frac{1}{648}

Question: An ant crawls straight from $(-4,6)$ to the origin, and then continues straight on to $(4,3)$. How far does it travel?

Choices:
A: 16
B: 2\sqrt{2}
C: 5
D: 5+2\sqrt{13}

Question: If the ratio of $2x-y$ to $x+y$ is 2 to 3, what is the ratio of $x$ to $y$? Express your answer as a common fraction.

Choices:
A: \frac{5}{4}
B: \frac{4}{5}
C: \frac{5}{2}
D: \frac{2}{5}

Question: A box contains 4 white balls and 4 black balls. I draw them out of the box, one at a time. What is the probability that all of my draws alternate colors?

Choices:
A: \frac{1}{8}
B: \frac{1}{7}
C: \frac{1}{40}
D: \frac{1}{35}

Question: Refer to the nextIntInRangemethod below:
 /** @return a random integer in the range low to high, inclusive */
 public int nextIntInRange(int low, int high)
 {
 return /* expression */
 }
 Which /* expression */ will always return a value that satisfies the postcondition?

Choices:
A: (int) (Math.random() * high) + low;
B: (int) (Math.random() * (high - low)) + low;
C: (int) (Math.random() * (high - low + 1)) + low;
D: (int) (Math.random() * (high + low)) + low;

Question: Express as a common fraction the reciprocal of $0.\overline7$.

Choices:
A: \frac{7}{2}
B: \frac{7}{9}
C: \frac{9}{2}
D: \frac{9}{7}

Question: Suppose 5 different integers are randomly chosen from between 20 and 69, inclusive. What is the probability that they each have a different tens digit?

Choices:
A: \frac{1}{4}
B: \frac{1}{3}
C: \frac{1000}{52969}
D: \frac{2500}{52969}

Question: Suppose that we roll two fair 6-sided dice. What is the probability that the two numbers rolled sum to 4?

Choices:
A: \frac{1}{4}
B: \frac{1}{12}
C: \frac{1}{3}
D: \frac{1}{9}

Question: The variable $x$ varies directly as the square of $y$, and $y$ varies directly as the cube of $z$. If $x$ equals $-16$ when $z$ equals 2, what is the value of $x$ when $z$ equals $\frac{1}{2}$?

Choices:
A: -1
B: 16
C: -\frac{1}{256}
D: \frac{1}{16}

Question: The quadratic $2x^2+5x+12=19-7x$ has two solutions. What is the positive difference between these solutions?

Choices:
A: 2
B: \sqrt{2}
C: 5\sqrt{2}
D: 5

Question: An integer c is a common divisor of two integers x and y if and only if c is a divisor of x and c is a divisor of y. Which of the following sets of integers could possibly be the set of all common divisors of two integers?

Choices:
A: {-6,-2, -1, 1, 2, 6}
B: {-6, -2, -1, 0, 1, 2, 6}
C: {-6, -3, -2, -1, 1, 2, 3, 6}
D: {-6, -3, -2, -1, 0, 1, 2, 3, 6}

Question: A point in space $(x,y,z)$ is randomly selected so that $-1\le x \le 1$,$-1\le y \le 1$,$-1\le z \le 1$. What is the probability that $x^2+y^2+z^2\le 1$?

Choices:
A: \frac{\pi}{24}
B: \frac{\pi}{12}
C: \frac{\pi}{6}
D: \frac{\pi}{3}

Question: Let R be a ring and let U and V be (two-sided) ideals of R. Which of the following must also be ideals of R ?
I. {u + v : u \in and v \in V}
II. {uv : u \in U and v \in V}
III. {x : x \in U and x \in V}

Choices:
A: II only
B: III only
C: I and II only
D: I and III only

Question: As punishment for bad behavior during recess, Mrs. Busywork asked her class to multiply 10 by $\frac{1}{3}$ five times. John, however, notices that it is possible to multiply 10 by a single fraction and still get the same answer as the other students. What is this single fraction?

Choices:
A: \frac{1}{27}
B: \frac{1}{68}
C: \frac{1}{3}
D: \frac{1}{243}

Question: What is the inverse of $f(x)=4-5x$?

Choices:
A: \frac{5}{x-4}
B: \frac{x-4}{5}
C: \frac{x+4}{5}
D: -\frac{x-4}{5}

Question: At breakfast, lunch, and dinner, Joe randomly chooses with equal probabilities either an apple, an orange, or a banana to eat. On a given day, what is the probability that Joe will eat at least two different kinds of fruit?

Choices:
A: \frac{7}{9}
B: \frac{8}{9}
C: \frac{5}{9}
D: \frac{9}{11}

Question: When three standard dice are tossed, the numbers $a,b,c$ are obtained. Find the probability that $abc = 180$.

Choices:
A: \frac{1}{30}
B: \frac{1}{72}
C: \frac{1}{71}
D: \frac{1}{70}

Question: Sam has $\frac{5}{8}$ of a pound of chocolate. If he eats $\frac{1}{3}$ of the chocolate he has, how many pounds of chocolate does he eat?

Choices:
A: \frac{5}{12}
B: \frac{5}{24}
C: \frac{3}{24}
D: \frac{3}{24}

Question: Compute the area of the triangle whose altitudes have lengths 10, 12, and 15.

Choices:
A: 56\sqrt{15}
B: 240\sqrt{7}
C: 60\sqrt{7}
D: 240\sqrt{7}/7

Question: Juan rolls a fair regular octahedral die marked with the numbers 1 through 8. Then Amal rolls a fair six-sided die. What is the probability that the product of the two rolls is a multiple of 3?

Choices:
A: \frac{1}{2}
B: \frac{1}{4}
C: \frac{1}{144}
D: \frac{1}{288}

Question: Which of the following is the hexadecimal representation of the decimal number 231_{10} ?

Choices:
A: 17_{16}
B: E4_{16}
C: E7_{16}
D: F4_{16}
